import React from "react";
import ReactDOM from "react-dom";
import "./Button.css";

const Button = (props) => {
  return (
    <div
      class="button"
      style={{
        display: "inline-block",
        width: props.width,
        height: props.height,
      }}
    >
      <a href="" class="text" style={{ lineHeight: props.height - 1 }}>
        {props.text}
      </a>
    </div>
  );
};

export default Button;
